import React from "react";
import {Avatar, Card} from 'antd';

const UserProfile = ()=>{
    return(
        <Card
            actions = {[
                <div key="twit">짹쨱<br/>8</div>,
                <div key="followings">팔로잉<br/>8</div>,
                <div key="followers">팔로워<br/>8</div>,
            ]}
        >
            <Card.Meta
                avartar={<Avatar>ZC</Avatar>}
                title="WooseokKim"
            />
            <Button>로그아웃</Button>
        </Card>
    )
}

export default UserProfile;
